import React, { useState } from "react";
import './App.css'
const App = () => {

  const initialState = [
    [false, false, false, false, false],
    [false, false, false, false, false],
    [false, false, false],
    [false, false, false, false],
  ]
  const [checkboxState, setCheckboxState] = useState(initialState);

  const arr = [
    [1990, 1991, 1992, 1993, 1994],
    [2000, 2001, 2002, 2003, 2004],
    [2010, 2011, 2012],
    [3001, 3002, 3003, 3004],
  ];

  const ParentCheckBox = (rowIndex) => {
    const updatedState = [...checkboxState];
    const rowChecked = updatedState[rowIndex].every((checked) => checked);
    updatedState[rowIndex] = rowChecked
      ? updatedState[rowIndex].map(() => false)
      : updatedState[rowIndex].map(() => true);
    setCheckboxState(updatedState);
  };

  const childcheckBox = (rowIndex, childIndex) => {
    const updatedState = [...checkboxState];
    updatedState[rowIndex][childIndex] = !updatedState[rowIndex][childIndex];
    setCheckboxState(updatedState);
  };

  const [RetriveValuesOfItems, setRetriveValuesOfItems] = useState([]);       // line 1 to 35

  const getCheckedValues = () => {
    const checkedValues = [];
    checkboxState.forEach((row, rowIndex) => {
      const makeRow = [];
      row.forEach((checked, childIndex) => {
        if (checked) {
          makeRow.push(arr[rowIndex][childIndex]);
        }
      });
      checkedValues.push(makeRow);
      setCheckboxState(initialState)
    });

    // value atla mate lidhi chhe bcz direct checkvalues enter kariye to empty breakets pan sathe sathe jaay chhe
    // je checkbox ni value select no thai hoy tyare teni row ma empty [] aave chhe tene remove karva mate value use karyu chhe
    const value = checkedValues?.filter((filterVal) => filterVal?.length != 0);
    setRetriveValuesOfItems(value);

    setCheckboxState(initialState)
  };

  const [images, setImages] = useState("none")
  const showImage = () => {
    if(images == "none"){
      setImages("block")
    }else{
      setImages("none")
    }
  }                                                           //line 36 to 62

  
  return (
    <div>


      {checkboxState.map((row, rowIndex) => (
        <div key={rowIndex}>
          <input
            type="checkbox"
            checked={row.every((checked) => checked)}
            onChange={() => ParentCheckBox(rowIndex)}
          />

          {row.map((checked, childIndex) => (
            <span key={childIndex}>
              <input
                type="checkbox"
                checked={checked}
                onChange={() => childcheckBox(rowIndex, childIndex)}
              />
              {arr[rowIndex][childIndex]}
            </span>
          ))}
        </div>
      ))}

      <button onClick={getCheckedValues}>submit</button>

      <h3>New Values:</h3>
      {RetriveValuesOfItems?.map((val, i) => (
        <span key={i}> {i+1}
          {val?.map((item, index) => (
            <span key={index}>{" " +item} </span>
            ))}
          <br />
        </span>
      ))}

      <div className="center">
      <button style={{marginTop:"20px"}} onClick={showImage}>Show Code</button>
      <img src="data:image/png;base64," alt="error" style={{display:`${images}`}} />
      <img src="data:image/png;base64," alt="error" style={{display:`${images}`}} />
      <img src="data:image/png;base64," alt="error" style={{display:`${images}`}} />
      </div>

      </div>
  );                                                                            // line 63 to 107 --> end 
};

export default App;
